import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Routes, Route }  from 'react-router-dom';
import Home from './components/home';
import Profile from './components/profile';
import Details from './components/details'
import { CardContent } from './components/data';
import Payment from './components/payment'
import ListTransaction from './components/list-transaction'
// import NavHeader from './components/navbar';
import PaymentApprove from './components/payment-approve';
import IncomeTrip from './components/income-trip';
import AddTrip from './components/add-trip';
import privateRoute from './components/privateRoute';
import { useState } from 'react';



function App() {
  const Data = CardContent()
  const storage = JSON.parse(localStorage.getItem("user"))
  const [isLogin, setLogin] = useState(false);
  return (
    <>
    <Router>
    <Routes>
      <Route path="/" element={<Home/>} />
      <Route path="/details/:id" element={<Details data={Data}/>} />
      <Route element={<privateRoute  islogin={isLogin}/>} >
        <Route path="/details/:id/payment" element={<Payment data={Data}/>} />
        <Route path="/details/:id/payment-approve" element={<PaymentApprove data={Data}/>} />
        <Route path="/profiles/:name" element={<Profile data={storage}/>} />
        <Route path="/list-transaction" element={<ListTransaction />} />
        <Route path="/income-trip" element={<IncomeTrip />} />
        <Route path="/add-trip" element={<AddTrip />} />
      </Route>
    </Routes>
    </Router>
    </>
  );
}

export default App;
